import React from "react";
import dp from "../assets/dp.jpeg";
export const Profile = () => {
  return (
    <div className="text-black w-full bg-white py-16 text-white px-4">
      Profile
    </div>
  );
};
export default Profile;
<div className="max-w-[1240px] mx-auto grid md:grid-cols-2">
  <img className="h-48 w-43" src={dp} alt="/" />
  <div>
    <p className="pl-10">Welcome to Dashboard</p>
    <h1>BIO</h1>
